// components/Header.js
import React from 'react';
import './Header.css';

const Header = () => {
  return (
    <header className="header">
      <div className="container">
        <div className="b">
          <center>
            <p className="b2">
              Explore our range of Agricultural submersible pumps <br />
              The product range covers applications like agriculture, water supply, sewage, and drainage.
            </p>
            <a href="products.html" className="btn">View Products</a>
          </center>
        </div>
      </div>
    </header>
  );
};

export default Header;
